import "./post.css"

export default function Post() {
  return (
    <div className="post">
      <img className ="postimg" src="https://i.pinimg.com/564x/99/55/f0/9955f0762afcdd60e052527af685caf3.jpg" alt="" />
      <div className="postinfo">
        <div className="postcats">
            <span className="postcat">music</span>
        </div>
      </div>
    </div>
  )
}
